import React, { useState } from "react";
import "./Courses.css";
const UploadCourses = () => {
  const [title, setTitle] = useState("");
  return (
    <div className="MainUploadCourseBlock">
      <div className="ChildUploadCourseBlock">
        <h2 style={{ color: "#da4ea2", textAlign: "center" }}>
          Upload Your Courses Here!
        </h2>
        <form>
          <label htmlFor="title">Title:</label>
          <input
            name="title"
            type="text"
            id="title"
            autoComplete="off"
            value={title}
            onChange={(e) => setTitle(e.target.value)}
            required
          />
          <br />
        </form>
      </div>
    </div>
  );
};

export default UploadCourses;
